import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#fff',
        paddingHorizontal: 20,
        paddingVertical: 20,
        borderRadius: 8,
        width: 200
    },
    header: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: 20
    },
    textHeader: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 20
    },
    textConfirm: {
        fontFamily: 'Inconsolata-Medium',
        fontSize: 18,
        lineHeight: 24,
        textAlign: 'center'
    },
    btnConfirm: {
        backgroundColor: '#d65246',
        paddingHorizontal: 20,
        paddingVertical: 10,
        borderRadius: 8,
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },
    textBtn: {
        fontFamily: 'Inconsolata-Medium',
        fontSize: 16,
        color: '#fff'
    },
});

export default styles;
